import React from 'react';
import s from './BigProjects.module.css';
import yerevan from '../../assets/images/yerevan.jpg';
import avto from '../../assets/images/avto.jpg';
import BigProjectCart from './BigProjectCart';
import itworld from '../../assets/images/itworld.am.png'

const BigProjects = (props) => {

    

    let carts = props.carts;

    let cartElemetns =
        carts.map(c => <BigProjectCart imgSrc={carts.imgSrc}
            imgAlt={carts.imgAlt}
            name={carts.name}
            description={carts.description} />)

    return (
        <div className={s.body}>
            <span id={s.bigProjects}>Big Projects</span>
            <span id={s.description}>SOME STARTUPS AND COMPANIES THAT I HELPED TO CREATE THEIR TECH</span>

            {cartElemetns}
        </div>
    );
}

export default BigProjects;
